var Cons = function(){
    var self = this;
    self.data = [
        {id:0, code:'FROZEN', des:"冻结"},
        {id:1, code:'NORMAL', des:"正常"}
    ];

    self.id = {};

    for(var i = 0; i < self.data.length; i++)
    {
        var set = self.data[i];
        self[set.code] = set;

        self.id[set.id] = set;
    }
};
module.exports = new Cons();

